double NeventTool::GetNevent_BKG(const std::string& dataset) const {
  if(m_Label2Nevent_BKG.count(dataset) == 0)
    return 0.;

  return m_Label2Nevent_BKG[dataset];
}

double NeventTool::GetNevent_SMS(const std::string& dataset, int MP, int MC) const {
  if(m_Label2Nevent_SMS.count(dataset) == 0)
    return 0.;

  std::pair<int,int> masses(MP,MC);

  if(m_Label2Nevent_SMS[dataset].count(masses) == 0)
    return 0.;

  return m_Label2Nevent_SMS[dataset][masses];
}

double NeventTool::GetNweight_BKG(const std::string& dataset) const {
  if(m_Label2Nweight_BKG.count(dataset) == 0)
    return 0.;

  return m_Label2Nweight_BKG[dataset];
}

double NeventTool::GetNweight_SMS(const std::string& dataset, int MP, int MC) const {
  if(m_Label2Nweight_SMS.count(dataset) == 0)
    return 0.;

  std::pair<int,int> masses(MP,MC);

  if(m_Label2Nweight_SMS[dataset].count(masses) == 0)
    return 0.;

  return m_Label2Nweight_SMS[dataset][masses];
}

